import React from "react";
import { Link } from "react-router-dom";
const UserEvent = () => {
  return (
    <div className="relative flex flex-grow flex-col items-center">
      <div className="px-6 sm:px-4 xl:px-0 xl:px-4 mx-auto w-full px-4 pb-0 sm:px-24 md:max-w-screen-xl lg:mt-6 lg:px-10 lg:pb-14 xl:px-10">
        <div className="flex flex-col gl:flex-row gl:gap-10">
          <div className="">
            <div className="px-15 bg-black py-12">
              <h1>Back</h1>
              <Link to="/home"></Link>
            </div>
            <div className="px-15 bg-black py-12"></div>
          </div>
          <div className="flex-1 bg-black">
            <h1>Your Events</h1>
          </div>
        </div>
      </div>
    </div>
  );
};

export default UserEvent;
